import React from 'react'
import profile from "../assets/profile.svg"
const Hero = () => {
  return (
    <div className='mx-auto max-w-7xl px-2 sm:px-6 lg:px-8'>
       <img src={profile} alt="hoobank" className="w-[124px] h-[32px]" />
      
      Hero</div>
  )
}

export default Hero
